import React from 'react';
import image2 from './image (1).png';
import image3 from './img2.jpeg';
import image4 from './ClariPhoto.jpeg';

// import Button from 'react-bootstrap/Button';
import video1 from './video1.mp4';

import './MyWork.css';
function MyWork() {
  return (

    <div class="row">
        <div class="column">

            <img src={image2}/>
            <img src={image3}/>
            <img src={image4}/>
            <img src="nature.jpg"/>
            <img src="mist.jpg"/>
            <img src="paris.jpg"/>
        </div>
        <div class="column">

            <img src={image2}/>
            <img src={image3}/>
            <img src={image4}/>
        </div>
        <div class="column">

            <img src={image2}/>
            <img src={image3}/>
            <img src={image4}/>
        </div>
        <div class="column">

            <img src={image2}/>
            <img src={image3}/>
            <img src={image4}/>
        </div>
    </div>

  );
}
export default MyWork;
